import React from 'react';
// import Edit_About from './Edit_About';

const About_Group = () => {

    // 接收資料
    const [groupAboutData, setGroupPageData] = React.useState(
        {
            articleId: 1342591834,
            authorImg: 'https://picsum.photos/id/1020/300/300',
            authorName: 'Show Lo',
            postDate: '2021/12/20',
            articleTitle: '前端工程師的酸甜苦辣',
            content: `<pre class="h3">話雖如慶每一個</pre><img class="w-75 d-block" src="data:image/jpeg;base64," alt=""><pre class="mt-3">的詩情畫意都能得到人們的欣賞鼓</pre>`,
            likesNum: 888
        }
    )

    const [editPostArticle, setEditPostArticle] = React.useState(false);

    return ( 
        <>
            {/* {editPostArticle && <Edit_About setEditPostArticle={setEditPostArticle}/>} */}
            <div className='about-group-set'>
                <div>
                    <div dangerouslySetInnerHTML={{__html: groupAboutData.content}}/>
                </div>
                <div className='about-group-set-btn btn' onClick={()=>setEditPostArticle(!editPostArticle)}>修改資料</div>
            </div>
        </>
     );
}
 
export default About_Group;